import React from 'react'
import { Alert } from 'react-bootstrap'
function Messageloginscreen() {
  return (
    <Alert  className='alert-danger alert-dismissible'>Request Failed With Status Code 404
    <button type="button"  class="btn btn-danger float-right" data-bs-dismiss="alert" aria-label="Close">X</button>
    </Alert>
  )
}

export default Messageloginscreen
